import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';
import Components from './Person/Person';


function App() {
  const [names, ages] = useState([
    {name: 'Bishal', age: '25'},
    {name: 'Raktim', age: '26'},
    {name: 'Yatra', age: '27'}
  ]);


  return (
    <div className="App">
    <h1>Learning React from Scratch!</h1>
    <Components name={names} />
    <Components name={names}>My Hobbies: Playing Chess</Components>
    <Components name={names} />
    </div>
  );
}

export default App;
